tables.table_schema:
CREATE TABLE personal_best_times (
    swimmer_id INT,
    event_name VARCHAR(50),
    best_time TIME,
    date_achieved DATE
);

CREATE TABLE personal_best_times (
    swimmer_id INT,
    event_name VARCHAR(50),
    timing DECIMAL(5,2),
    date_achieved DATE
);

CREATE TABLE achievements (
    swimmer_id INT,
    achievement_name VARCHAR(50),
    achievement_date DATE,
    earned_medal BOOLEAN
);

CREATE TABLE swimmers (
    swimmer_id INT PRIMARY KEY,
    full_name VARCHAR(100),
    birth_date DATE,
    nationality VARCHAR(50)
);

CREATE TABLE PersonalBestTimes (
   id UUID PRIMARY KEY,
   swimmer_id UUID REFERENCES Swimmers(id),
   event_name VARCHAR(100),
   time FLOAT
);

CREATE TABLE Achievements (
   id UUID PRIMARY KEY,
   swimmer_id UUID REFERENCES Swimmers(id),
   achievement_name VARCHAR(100),
   date_achieved DATE
);

CREATE TABLE Teams (id INT PRIMARY KEY,
 team_name VARCHAR(255) NOT NULL,
 coach_name VARCHAR(255));
